import React, { useState } from "react";
import { FaBoxOpen, FaShoppingCart, FaUsers } from "react-icons/fa";

export default function AdminPanelSimple() {
  const [activeTab, setActiveTab] = useState("products");

  const headerTitle = activeTab === "products"
    ? "Manage Products"
    : activeTab === "orders"
      ? "Orders & Analytics"
      : "Users";

  return (
    <div className="min-h-screen bg-gray-100 dark:bg-gray-900 text-gray-800 dark:text-gray-100 p-6">
      <div className="flex">
        {/* Sidebar */}
        <aside className="w-64 bg-white dark:bg-gray-800 p-6 rounded shadow mr-6">
          <h1 className="text-xl font-bold mb-4">Admin</h1>
          <nav className="flex flex-col gap-2">
            <button
              className={`flex items-center gap-2 p-2 rounded ${activeTab === "products" ? "bg-blue-600 text-white" : ""}`}
              onClick={() => setActiveTab("products")}
            >
              <FaBoxOpen /> Products
            </button>
            <button
              className={`flex items-center gap-2 p-2 rounded ${activeTab === "orders" ? "bg-blue-600 text-white" : ""}`}
              onClick={() => setActiveTab("orders")}
            >
              <FaShoppingCart /> Orders
            </button>
            <button
              className={`flex items-center gap-2 p-2 rounded ${activeTab === "users" ? "bg-blue-600 text-white" : ""}`}
              onClick={() => setActiveTab("users")}
            >
              <FaUsers /> Users
            </button>
          </nav>
        </aside>

        {/* Main */}
        <main className="flex-1">
          <h2 className="text-2xl font-bold mb-4">{headerTitle}</h2>
          {activeTab === "products" && <div>Products table / form goes here</div>}
          {activeTab === "orders" && <div>Orders chart / table goes here</div>}
          {activeTab === "users" && <div>Users table goes here</div>}
        </main>
      </div>
    </div>
  );
}
